const rootSelector="[data-js-input-mask]";class InputMask{constructor(t){this.rootElement=t,this.init()}init(){void 0!==window.IMask?window.IMask(this.rootElement,{mask:this.rootElement.dataset.jsInputMask}):console.error("Library 'IMask' is not connected!")}}class InputMaskCollection{constructor(){this.init()}init(){document.querySelectorAll(rootSelector).forEach((t=>new InputMask(t)))}}export default InputMaskCollection;